define(['jquery','mage/translate','Magento_Ui/js/modal/confirm','domReady!'],function($,$t,confirm){'use strict';return function(config,inputEl){var $inputEl=$(inputEl);$inputEl.on('blur',function(){var inputVal=parseInt($inputEl.val(),10);if(256000>inputVal){confirm({title:$t(config.modalTitleText),content:$t(config.modalContentBody),buttons:[{text:$t('No'),class:'action-secondary action-dismiss',click:function(event){this.closeModal(event);}},{text:$t('Yes'),class:'action-primary action-accept',click:function(event){this.closeModal(event,true);}}],actions:{cancel:function(){$inputEl.val(256000);}}});}});};});